import React, {Component} from 'react';
import './App.css';
import PropTypes from 'prop-types';

class Decrement extends Component{
  render(){
    return <div class = "card">
              <button> Decrement </button>
              <p> {this.props.num} </p>
           </div>
  }
};

Decrement.propTypes = {
  num:PropTypes.number.isRequired
}


function App() {
  return <div>
            <Decrement num="12"/>
         </div>
}

export default App;
